import React, {Component} from 'react';

const ImageList = (props) => {

    const preparedImages = props.images.map(image => {
        return (
            // <img src={image.urls.small} alt="s"/>
            <div>{image} adet </div>
        )
    })

    return (
        <div>
            {preparedImages}
        </div>
    )
}

export default ImageList;
